webpackJsonp([89926328501068],{374:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Mike Herchel",author:"Mike Herchel"}},markdownRemark:{id:"/Users/mherchel/sites/herchel-new/src/blog/2013-10-20-drupalcamp-atlanta-session-notes/index.md absPath of file >>> MarkdownRemark",html:'<p>This presentation is a rehash of my 2012 Florida Drupalcamp presentation, Simple Ways to Awesomize® Drupal’s Page Load Times.</p>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr"><a href="https://twitter.com/mikeherchel?ref_src=twsrc%5Etfw">@mikeherchel</a> &#39;s preso: <a href="https://twitter.com/hashtag/Drupal?src=hash&amp;ref_src=twsrc%5Etfw">#Drupal</a> performance rocked! &quot;I pity the fool who doesn&#39;t aggregate his CSS &amp; Javascript!&quot; <a href="https://twitter.com/DrupalCamp_ATL?ref_src=twsrc%5Etfw">@DrupalCamp_ATL</a> <a href="https://twitter.com/MrT?ref_src=twsrc%5Etfw">@mrt</a></p>&mdash; Ben Finklea (@BenFinklea) <a href="https://twitter.com/BenFinklea/status/391580486252122112?ref_src=twsrc%5Etfw">October 19, 2013</a></blockquote>\n<p>It goes into various front-end, back-end, and site-building techniques to help out what I consider to be one of Drupal’s biggest issue: page-load times.</p>\n<p>Enjoy!</p>\n<p><a href="https://speakerdeck.com/mherchel/simple-ways-to-awesomize-r-drupals-page-load-times">https://speakerdeck.com/mherchel/simple-ways-to-awesomize-r-drupals-page-load-times</a></p>',frontmatter:{title:"DrupalCamp Atlanta Presentation Notes",date:"October 20, 2013"}}},pathContext:{slug:"/2013-10-20-drupalcamp-atlanta-session-notes/"}}}});
